import React, { Component } from 'react';
import './Skills.css';
import Menu from '../../components/Menu/Menu';
import  { skillList } from '../../shared/skills';
import SkillProgress from '../../components/SkillProgress/SkillProgress';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import { Line } from 'rc-progress';
import { icons } from '../../shared/skillIcons';

import { library } from '@fortawesome/fontawesome-svg-core';
import { faPython } from '@fortawesome/free-brands-svg-icons';
import { faAngular } from '@fortawesome/free-brands-svg-icons';
import { faReact } from '@fortawesome/free-brands-svg-icons';
import { faSwift } from '@fortawesome/free-brands-svg-icons';
import { faHtml5 } from '@fortawesome/free-brands-svg-icons';
import { faCss3 } from '@fortawesome/free-brands-svg-icons';
import { faBootstrap } from '@fortawesome/free-brands-svg-icons';

library.add(faPython, faAngular, faReact, faSwift, faHtml5, faCss3, faBootstrap);




class Skills extends Component {
    render() {
        let skills =  Object.entries(icons).map(([key, value]) => 
            <div className="ProgressBar">
                <p className="IconName">
                    <span style={{flex: 1, paddingTop: '10%'}}>{key}</span><FontAwesomeIcon className="Icons" icon={[value, key]}  style={{color:'f37121'}}/>
                </p>
                <Line percent={skillList[key]} strokeWidth="3" strokeColor="#fe8a71" />
            </div> 
    );

        return(
            <div>
                <div className="SmallOrangeSpace"></div>
                <Menu/>
                <div className="Skills">
                    <h1>Skills</h1>
                    <div className="SkillList">
                        {skills}
                    </div>
                </div>
            </div>
        );
    }
}
export default Skills;
